import React from "react";
import Card from "./Card";
import contacts from "../contacts";

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Card 
      name={contacts[0].name}
      img={contacts[0].img}
      tel = {contacts[0].tel}
      email = {contacts[0].email}
      />
      <Card 
      name={contacts[1].name}
      img={contacts[1].img}
      tel = "+123 456 789"
      email = "b@beyonce.com"
      />

    </div>
  );
}

export default App;
